职位描述
高级开发人员岗位要求:
1、熟悉常用的设计模式,有相关开发经验;
2、熟练使用Spring、Hibernate、 Rest. JQuery、 Java、 Sql等主流的开发框架和开发语言;
3.有WEB相关工作经验;
4、精通Javascript编程语言，熟悉 IQuery、Doj0等开源框架;
5、有Weblogic Portal等开发、实施经验优先;
6、熟悉Linux操作系统基本命令,能独立完成Linux系统中间件安装配置及程序部署,如Jdk、tomcat等 ;
7、熟悉数据库相关知识,能够熟练应用主流的一种数据库进行开发;
8、英语4级以上,具备较强英文文档阅读能力优先;
9、有良好的编码习惯,遵守团队开发规范和代码规范;
10、工作积极主动,责任心强,有较强沟通能力和学习能力,具备团队意识,能够承受较高强度的工作压
力。
